import Pratiche from "./Pratiche";

class PraticheManager {
    
    loadPratiche(email) {
        /**
         * serve per gestire il load delle pratiche. poi dovrà prendere in input la mail dell'utente loggato
         */
        Pratiche.loadPratiche();
    }
}

export default PraticheManager;
